ISLAMABAD, Jan 24 (APP): Pakistan Tehreek-e-Insaf (PTI) Senator Faisal Javed Khan on Monday said that PTI would succeed once again with its performance, just as PTI has returned due to its performance in Khyber Pakhtunkhwa.
In a tweet, he hoped that general elections would be held in October 2023 next year and the people would once again vote for Prime Minister Imran Khan.
